(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["chunk-2d0e28f6"],{"7ee7":function(t){t.exports=JSON.parse('[{"start":[{"name":"Uriah:","content":"I hear you\'ve been looking for me."},{"name":"Navigator:","content":"Regardless of what I think, I\'m sure this must have something to do with you."},{"name":"Uriah:","content":"What\'s wrong? From your tone, it almost seems as though I have done something wrong."},{"name":"Navigator:","content":"No... I wouldn\'t say that, exactly..."},{"name":"Navigator:","content":"Anyway... Can we talk for a minute?"},{"name":"Uriah:","content":"Sure, but please wait a moment... Hey, you\'re not planning to invite me on a date, are you?"}],"branch":[{"name":"Navigator:","content":"W-What!? What are you saying!?"},{"name":"Navigator:","content":"Yes, it\'s a date..."}],"chatlist":[{"start":[],"branch":[{"name":"Navigator:","content":"W-What!? What are you saying!?"}]},{"start":[{"name":"Uriah:","content":"You look so nervous. I was just kidding, of course."},{"name":"Navigator:","content":"Please don\'t joke around about things like that!"},{"name":"Uriah:","content":"There\'s no need to be rude..."},{"name":"Uriah:","content":"Anyway, let\'s meet in the lounge."},{"name":"Navigator:","content":"I\'ll go get ready then!"}],"branch":[]},{"start":[],"branch":[{"name":"Navigator:","content":"Yes, it\'s a date..."}]},{"start":[{"name":"Uriah:","content":"Oh? How interesting. I\'m looking forward to it."},{"name":"Navigator:","content":"That\'s not what I meant! Stop taking everything I say the wrong way!"},{"name":"Uriah:","content":"We\'re going out! It\'s so exciting!"},{"name":"Uriah:","content":"Anyway, let\'s meet in the lounge."},{"name":"Navigator:","content":"I\'ll go get ready then!"}],"branch":[]}]},{"start":[{"name":"Uriah:","content":"Looking for me again?"},{"name":"Navigator:","content":"We made an agreement! You said you would tell me about you!"},{"name":"Navigator:","content":"How could you stand me up like that!?"},{"name":"Uriah:","content":"You misunderstood. I thought you were immersed in your grief so I went to pray for you first."}],"branch":[{"name":"Navigator:","content":"I... I misunderstood?"},{"name":"Navigator:","content":"Don\'t lie to me!"}],"chatlist":[{"start":[],"branch":[{"name":"Navigator:","content":"I... I misunderstood?"}]},{"start":[{"name":"Uriah:","content":"That\'s right, you misunderstood."},{"name":"Navigator:","content":"Ah... I-I\'m sorry."},{"name":"Navigator:","content":"No!... How is this happening to me again!?"},{"name":"Uriah:","content":"Alright, enough joking around. I haven\'t forgotten our agreement."}],"branch":[]},{"start":[],"branch":[{"name":"Navigator:","content":"Don\'t lie to me!"}]},{"start":[{"name":"Uriah:","content":"It makes me sad to hear you say that..."},{"name":"Navigator:","content":"Ah... I-I\'m sorry."},{"name":"Navigator:","content":"No!... How is this happening to me again!?"},{"name":"Uriah:","content":"Alright, enough joking around. I haven\'t forgotten our agreement."}],"branch":[]}]},{"start":[{"name":"Uriah:","content":"I would like to express my utmost respect to you with the supreme courtesy of Lumopolis."},{"name":"Navigator:","content":"Uh... Thanks. But isn\'t that a little over the top?"},{"name":"Uriah:","content":"This level of etiquette is essential, whether you\'re awake or fast asleep."},{"name":"Navigator:","content":"I always feel like there\'s something more hidden in your words..."},{"name":"Uriah:","content":"I apologize if I\'ve caused you any distress."},{"name":"Uriah:","content":"It\'s an occupational hazard. I can\'t help remembering and expressing my grief... The praying, the mourning..."},{"name":"Uriah:","content":"Although these sacred eulogies are supposed to send off the departed, they are more important for appeasing the living."},{"name":"Uriah:","content":"Life is beautiful, and the glory of the dead will shine on the living."},{"name":"Navigator:","content":"Of course, it will."},{"name":"Uriah:","content":"However, I\'d like to apologize again. It is not my intention to bring you harm."},{"name":"Uriah:","content":"I\'m afraid that all I can do to earn your forgiveness is to present you with this white flower I grew myself."},{"name":"Uriah:","content":"I hope its white petals may soothe your wounded heart."},{"name":"Navigator:","content":"Thank you, this white flower is beautiful... But isn\'t it a reagent for your... work?"},{"name":"Uriah:","content":"Please don\'t worry. Although it\'s a farewell flower, it doesn\'t mean it\'s some kind of vicious curse. On the contrary, it is a blessing."},{"name":"Navigator:","content":"A blessing?"},{"name":"Uriah:","content":"No one can accompany you throughout the loneliness of life, but those who bid you farewell will continue to warm your heart from the depths of your memories."},{"name":"Uriah:","content":"Its unfading white petals will be painted by the colors of life, forever surrounding you so that you will never be lonely."}],"branch":[],"chatlist":[]},{"start":[{"name":"Uriah:","content":"Greetings. Are you up yet, my lord?"},{"name":"Navigator:","content":"I don\'t know why... but being called a \\"Lord\\" always makes me feel uncomfortable..."},{"name":"Uriah:","content":"So if you ever run into children from Keating, you might find yourself feeling very uncomfortable indeed."},{"name":"Navigator:","content":"It\'s not just me... I think most people feel uncomfortable when running into them."}],"branch":[],"chatlist":[]},{"start":[{"name":"Uriah:","content":"Good morning. Would you like to join me in prayer?"}],"branch":[{"name":"Navigator:","content":"Sure."},{"name":"Navigator:","content":"No, thanks."}],"chatlist":[{"start":[],"branch":[{"name":"Navigator:","content":"Sure."}]},{"start":[{"name":"Uriah:","content":"In that case, allow me to begin."},{"name":"Navigator:","content":"But I don\'t really know what to pray for..."},{"name":"Uriah:","content":"It\'s pretty simple. Come, let us pray together..."},{"name":"Uriah:","content":"For a wonderful breakfast this morning!"},{"name":"Navigator:","content":"But... I\'ve already grabbed my breakfast..."},{"name":"Uriah:","content":"Well... Breakfast always tastes better after prayer!"},{"name":"Navigator:","content":"Is that really true?"}],"branch":[]},{"start":[],"branch":[{"name":"Navigator:","content":"No, thanks."}]},{"start":[{"name":"Navigator:","content":"I don\'t really know what to pray for..."},{"name":"Uriah:","content":"It\'s pretty simple. Come, let us pray together..."},{"name":"Uriah:","content":"For a wonderful breakfast this morning!"},{"name":"Navigator:","content":"But... I\'ve already grabbed my breakfast..."},{"name":"Uriah:","content":"Well... Breakfast always tastes better after prayer!"},{"name":"Navigator:","content":"Is that really true?"}],"branch":[]}]},{"start":[{"name":"Uriah:","content":"Are you asleep, Navigator? Even if you have matters to attend to, you shouldn\'t force yourself."},{"name":"Navigator:","content":"I know. I\'ll try to go to bed earlier."},{"name":"Uriah:","content":"No, just go to sleep now, okay?"},{"name":"Navigator:","content":"Well, I suppose there\'s no dissuading you."}],"branch":[],"chatlist":[]},{"start":[{"name":"Uriah:","content":"Another day gradually fades away..."},{"name":"Navigator:","content":"You sound kind of glum, Uriah."},{"name":"Uriah:","content":"Not at all. I am just somewhat sensitive to the idea of transience."},{"name":"Uriah:","content":"All things must come to pass in their own time."},{"name":"Navigator:","content":"When you put it that way, now I can\'t help but feel down..."},{"name":"Uriah:","content":"There\'s no need to feel sad, Navigator. We are capable of accomplishing so much, even with the bit of time given to us."},{"name":"Uriah:","content":"We can offer our sincerest condolences for the days that have come and gone."},{"name":"Uriah:","content":"We can also go to bed earlier..."},{"name":"Uriah:","content":"So that we may wake and greet the new day with open arms."},{"name":"Navigator:","content":"I agree. Well then, I\'m off to bed. Good night!"},{"name":"Uriah:","content":"Good night, and may you rest in peace."},{"name":"Navigator:","content":"H-Huh? Are you...? What was that?"},{"name":"Uriah:","content":"I am simply mourning the passing of the Navigator of today."},{"name":"Uriah:","content":"As for the Navigator of tomorrow, I am prepared to offer my warmest blessings."}],"branch":[],"chatlist":[]},{"start":[{"name":"Uriah:","content":"It is quite late, Navigator."},{"name":"Uriah:","content":"Do you still have much to do for today?"},{"name":"Navigator:","content":"Not really. I\'m chatting with everyone, including you."},{"name":"Uriah:","content":"To be able to spend your nights happily chatting with your friends..."},{"name":"Uriah:","content":"You are blessed, indeed."},{"name":"Navigator:","content":"Thanks. But I\'m worried about my health if I keep staying up late like this..."},{"name":"Uriah:","content":"I\'ll pray for your health. And if you are sick someday, I will offer my condolences to your lost health."},{"name":"Navigator:","content":"I think... I should go to bed now. Good night!"},{"name":"Uriah:","content":"Good night, and may you rest in peace."}],"branch":[],"chatlist":[]}]')}}]);
